Buenas invocadores!

Una consulta... Con respecto a la raza de peleadores, me corrigen o me nombran el peleador que falta? Tuve una partida donde consegui 5 peleadores pero me falto un 6to y nunca pude encontrarlo, y eso me hizo pensar que falta 1 peleador en la clase.

Warwick, Reksai, Volibear, Chogath, Blitzcrank y quién falta? Tengo esa duda existencial {{sticker:sg-zephyr}}
